job_detail:
岗位职责:
 负责别样iOS平台的客户端开发和维护;
 负责核心模块的开发,解决团队疑难问题;
 对现有技术有宏观思考能力,总结归纳,形成统一的框架或解决方案;
 指导与培训团队成员,让团队更好成长;
岗位要求:    1. 计算机相关专业,本科及以上学历;    2. 5年及以上iOS开发经验, 深刻理解Runtime, 内存管理策略, 有一定的性能优化经验, 在组件化有丰富的实践经验;    3. 能独立承担架构设计,有较强的发现、分析和解决技术问题的能力;    4. 沟通能力良好,责任心强, 对技术有激情, 有良好的快速学习能力;    5. 有开源项目或者参与过大型项目的优先;
